<!doctype html><html lang="es"><head><meta charset="utf-8"/><meta name="viewport" content="width=device-width,user-scalable=no"/><meta name="description" content="Dashboard"/><title>Data Quality Assurance | BBVA</title><link rel="shorcut icon" href="https://raw.githubusercontent.com/rambay/react-spa-bbva/master/public/assets/icon.ico?token=AF4K7UPZDYVDPI4LRQCK6HTADBLPE"/><link href="https://fonts.googleapis.com/css2?family=Lato:ital,wght@0,400;0,700;1,400&family=Open+Sans:wght@700&display=swap" rel="stylesheet"/><link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/5.12.1/css/all.min.css"/><link href="https://spa-react-bbva.web.app/css/app.css" rel="stylesheet"></head><script>// Single Page Apps for GitHub Pages
    // https://github.com/rafrex/spa-github-pages
    // Copyright (c) 2016 Rafael Pedicini, licensed under the MIT License
    // ----------------------------------------------------------------------
    // This script checks to see if a redirect is present in the query string
    // and converts it back into the correct url and adds it to the
    // browser's history using window.history.replaceState(...),
    // which won't cause the browser to attempt to load the new url.
    // When the single page app is loaded further down in this file,
    // the correct url will be waiting in the browser's history for
    // the single page app to route accordingly.
    (function (l) {
      if (l.search) {
        var q = {};
        l.search
          .slice(1)
          .split("&")
          .forEach(function (v) {
            var a = v.split("=");
            q[a[0]] = a.slice(1).join("=").replace(/~and~/g, "&");
          });
        if (q.p !== undefined) {
          window.history.replaceState(
            null,
            null,
            l.pathname.slice(0, -1) +
              (q.p || "") +
              (q.q ? "?" + q.q : "") +
              l.hash
          );
        }
      }
    })(window.location);</script><body><div id="app"></div><div id="toggleMenu"></div><script src="https://apis.google.com/js/api.js"></script><script src="https://spa-react-bbva.web.app/js/modules.21238309295331bc26bf.dll.js"></script><script src="https://spa-react-bbva.web.app/js/app.45d0b2932b51580f2566.js"></script></body></html>
